import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import './css/style.css'


export default function TextField4() {
    return (
        <div>
            <TextField id="textField34" label="" variant="filled" fullWidth />
            <Stack direction='row' alignItems="center" style={{ marginTop: '2px', padding: '6px 8px' }} spacing={1}>
                <Button variant="text" className='button'>JPY</Button>
                <Button variant="text" className='button'>BHD</Button>
            </Stack>
        </div>
    )
}
